INSERT INTO `jos_emundus_setup_emails` VALUES (1,'confirm_post','Application form sent / Dossier de candidature envoyé','','<p>Congratulations, you have posted your application form.</p>\n<hr />\n<p>F&eacute;licitations, vous venez d\'envoyer votre dossier de candidature.</p>','',1,1,1,0,0,'Système','',0),(2,'attachment','An attachment has been uploaded to your application file / Un document a été téléchargé sur votre dossier','','<p>Dear [NAME],</p>\n<p>A new document has been uploaded on your application file.</p>\n<p>Best regards,</p>\n<hr />\n<p>Cher [NAME],</p>\n<p>Un nouveau document a &eacute;t&eacute; ajout&eacute; &agrave; votre dossier de candidature.</p>\n<p>Cordialement,</p>','',1,1,1,0,0,'Système','',0),(5,'new_account','New account information / Nouveau compte','','<p>Your name : [NAME] <br />Your email : [EMAIL] <br />Your username : [USERNAME] <br />Your password : [PASSWORD]</p>\n<p>Dear [NAME], <br />A new account has been created for you for the application plateform : <a href=\"[SITE_URL]\">[SITE_URL]</a><br />Kind Regards,</p>\n<hr />\n<p>Votre nom : [NAME] <br />Votre email : [EMAIL] <br />Votre nom d\'utilisateur : [USERNAME] <br />Votre mot de passe : [PASSWORD]</p>\n<p>Cher [NAME], <br />Un nouveau compte a &eacute;t&eacute; cr&eacute;&eacute; pour vous sur la plateforme de candidature : <a href=\"[SITE_URL]\">[SITE_URL]</a><br />Cordialement,</p>','',1,1,1,NULL,NULL,'Système',NULL,NULL),(8,'referent_letter','Request for a letter of recommendation / Sollicitation de lettre de recommandation','','<p>Dear Colleague,</p>\n<p><br />You have been chosen by [NAME] ([EMAIL]) to be his referee to complete her/his application to our program. <br />Please <a href=\"[UPLOAD_URL]\">upload the recommendation letter</a> by using the following link.</p>\n<p>Notice that the application of the student will have an \"incomplete status\" unless you <a href=\"[UPLOAD_URL]\">add the letter</a>.</p>\n<p>In case you would not like to add a recommendation letter for this student, please let her/him know.</p>\n<p>&nbsp;</p>\n<p>Thank you for your collaboration.</p>\n<p>Sincerely,<br /><br /></p>\n<p>P.S.: please note that you may only <a href=\"[UPLOAD_URL]\">upload one document</a> for each student.</p>\n<p>Click <a href=\"[UPLOAD_URL]\">HERE </a>to upload reference letter.</p>\n<p>If link does not work, please copy and paste that hyperlink in your browser: [UPLOAD_URL]</p>\n<hr />\n<p>Cher Coll&egrave;gue,</p>\n<p><br />Vous avez &eacute;t&eacute; s&eacute;lectionn&eacute; par [NAME] ([EMAIL]) pour &ecirc;tre son r&eacute;f&eacute;rent afin qu\'il/elle puisse finaliser leur candidature. <br />Veuillez <a href=\"[UPLOAD_URL]\">t&eacute;l&eacute;charger votre lettre de recommandation</a> en suivant le lien.</p>\n<p>Le dossier de candidature restera en statut \"incomplet\" tant que vous <a href=\"[UPLOAD_URL]\">n\'envoyez pas la lettre</a>.</p>\n<p>&nbsp;</p>\n<p>Merci de votre collaboration.</p>\n<p>Cordialement,<br /><br /></p>\n<p>P.S.: Vous ne pouvez envoyer qu\'un seul document.</p>\n<p>Si le lien ne fonctionne pas, veuillez copier et coller le lien suivant dans votre navigateur : [UPLOAD_URL]</p>','',1,0,1,NULL,NULL,'Système',NULL,NULL),(9,'attachment_notification','Attachment have been uploaded for applicant / Nouveau document téléchargé sur un dossier','','<p>A new document has been uploaded on personal page of [NAME].</p>\n<hr />\n<p>Un nouveau document a &eacute;t&eacute; ajout&eacute; au dossier de candidature de [NAME].</p>','',1,1,1,0,0,'Système','',0),(15,'reminder','Application not finished / Dossier non-terminé','','<p>Dear [NAME],<br /><br />Your application for [CAMPAIGN_LABEL] is not yet complete. Please complete it in order to finish your application.</p>\n<p>You can access to our website by this address: <a href=\"[SITE_URL]\">[SITE_URL]</a>. Remember the deadline is the [CAMPAIGN_END].</p>\n<p>Sincerely,</p>\n<hr />\n<p>Cher [NAME],</p>\n<p>Votre candidature pour [CAMPAIGN_LABEL] n\'est pas encore termin&eacute;e. Veuillez la renseigner afin de pouvoir envoyer votre dossier.</p>\n<p>Vous pouvez acc&eacute;der au site via cette adresse : <a href=\"[SITE_URL]\">[SITE_URL]</a>.<br />N\'oubliez pas que la date limite est le : [CAMPAIGN_END].</p>\n<p>Cordialement,</p>','',1,1,1,NULL,NULL,'Système',NULL,NULL),(72,'registration_email','Activate your account / Activez votre compte','','<p>[USER_NAME],</p>\n<p>Thank you for signing up to the application platform.</p>\n<p>In order to activate your account please click on the link below:&nbsp;</p>\n<table style=\"margin-left: auto; margin-right: auto;\" border=\"0\">\n    <tbody>\n    <tr>\n        <td>\n            <table border=\"0\">\n                <tbody>\n                <tr>\n                    <td style=\"border-radius: 3px; text-align: center;\"><a style=\"font-size: 16px; font-family: Helvetica, Arial, sans-serif; color: #ffffff; background-color: #26a65b; text-decoration: none; border-radius: 3px; padding: 12px 18px; border: 1px solid #26a65b; display: inline-block;\" href=\"[ACTIVATION_URL]\" target=\"_blank\" rel=\"noopener noreferrer\">ACTIVATE MY ACCOUNT</a></td>\n                </tr>\n                </tbody>\n            </table>\n        </td>\n    </tr>\n    </tbody>\n</table>\n<p style=\"text-align: left;\">Your username: [USER_LOGIN]</p>\n<hr />\n<p>[USER_NAME],</p>\n<p>Merci de vous &ecirc;tre inscrit sur la plateforme de candidature.</p>\n<p>Afin de pouvoir activer votre compte, veuillez cliquer sur le lien ci-dessous :&nbsp;</p>\n<table style=\"margin-left: auto; margin-right: auto;\" border=\"0\">\n    <tbody>\n    <tr>\n        <td>\n            <table border=\"0\">\n                <tbody>\n                <tr>\n                    <td style=\"border-radius: 3px; text-align: center;\"><a style=\"font-size: 16px; font-family: Helvetica, Arial, sans-serif; color: #ffffff; background-color: #26a65b; text-decoration: none; border-radius: 3px; padding: 12px 18px; border: 1px solid #26a65b; display: inline-block;\" href=\"[ACTIVATION_URL]\" target=\"_blank\" rel=\"noopener noreferrer\">ACTIVER MON COMPTE</a></td>\n                </tr>\n                </tbody>\n            </table>\n        </td>\n    </tr>\n    </tbody>\n</table>\n<p>&nbsp;Votre login : [USER_LOGIN]&nbsp;</p>','',1,1,1,0,0,'Système','',0),(73,'delete_file','Application file deleted / Dossier supprimé','','<p>Dear [NAME],</p>\n<p>Your application file <strong><em>[FNUM]</em></strong> has been deleted.</p>\n<p>A zip file containing the data deleted is attached to this email.</p>\n<hr />\n<p>Bonjour [NAME],</p>\n<p>Votre dossier de candidature <strong><em>[FNUM]</em></strong> vient d\'&ecirc;tre supprim&eacute;.</p>\n<p>Ci-joint, une archive des informations qui ont &eacute;t&eacute; supprim&eacute;es.</p>','',1,1,1,NULL,NULL,'Système',NULL,NULL),(74,'delete_user','User account deleted / Compte utilisateur supprimé','','<p>Hello [NAME],</p>\n<p>Your account has been deleted.<br /></p>\n<hr />\n<p>Bonjour [NAME],</p>\n<p>Votre compte utilisateur a &eacute;t&eacute; supprim&eacute;.<br /></p>','',1,1,1,0,0,'Système','',0),(75,'regenerate_password','Password reset / Regénération de votre mot de passe','','<p>Hello,</p>\n<p>Here is your new password: <strong>[PASSWORD]</strong></p>\n<p>We strongly recommend that you change it new time you log in.</p>\n<hr />\n<p>Bonjour,</p>\n<p>Voici votre nouveau mot de passe : <strong>[PASSWORD]</strong></p>\n<p>N\'oubliez pas de le modifier lors de votre prochaine connexion.</p>','',1,1,1,0,0,'Système','',0),(76,'share_with_evaluator','Access to application files / Accès aux dossiers de candidature','','<p>Bonjour [NAME],</p>\n<p>De nouveaux dossiers de candidature sont disponibles sur la plateforme :</p>\n<p>[FNUMS]</p>\n<hr />\n<p>Dear [NAME],</p>\n<p>New application files are now visible for you on the platform:</p>\n<p>[FNUMS]</p>','',1,1,1,0,0,'Système','',0),(77,'limit_obtained_alert','Campaign limit reached / Limite atteinte sur une campagne','','<p>Hello [NAME],</p>\n<p>The [CAMPAIGN_LABEL] campaign has reached its application limit.<br />From this moment on, candidates can no longer send or edit their application.<br />However, the campaign remains visible on the homepage, without the possibility to apply. If you wish to remove it from the homepage, you must unpublish this campaign.</p>\n<p>Sincerely</p>\n<hr />\n<p>Bonjour [NAME],</p>\n<p>La campagne <strong>[CAMPAIGN_LABEL]</strong> vient d\'atteindre sa limite de candidature.<br />&Agrave; partir de ce moment, les candidats ne peuvent plus envoyer, ni &eacute;diter leur dossier. <br />La campagne reste cependant visible sur la page d\'accueil, sans avoir la possibilit&eacute; de candidater. Si vous d&eacute;sirer la retirer sur la page d\'accueil, vous devez d&eacute;publier cette campagne.</p>\n<p>Cordialement</p>','',1,1,1,0,0,'Système','',0),(78,'expert','Expertise request / Demande d\'expertises','','<p><strong>Expertise de dossiers scientifiques dans le cadre de [CAMPAIGN_LABEL]</strong> <br /><br />Cher(&egrave;re) Coll&egrave;gue,<br /><br />Nous serions heureux que vous puissiez nous aider &agrave; expertiser un dossier dans le cadre de l&rsquo;appel [CAMPAIGN_LABEL] et nous vous en remercions par avance. <br /><br />Afin de pouvoir acc&eacute;der &agrave; l&rsquo;ensemble du dossier, je vous remercie de bien vouloir accepter la signature de la charte de confidentialit&eacute; &agrave; l&rsquo;aide du lien ci-apr&egrave;s :</p>\n<ul>\n<li><a href=\"[EXPERT_ACCEPT_LINK]\">I accept</a> (please check the non-conflict charter).</li>\n<li><a href=\"[EXPERT_REFUSE_LINK]\">I do NOT accept</a></li>\n</ul>','',1,0,1,NULL,NULL,'Système','',NULL),(79,'messenger_reminder','Unread Messages / Messages non-lus','','<p>Vous avez des messages non lus sur <a href=\"[SITE_URL]\">[SITE_URL]</a>. Veuillez vous reconnecter afin d\'en prendre connaissances.</p>\n<p>Cordialement,</p>\n<hr />\n<p>You have unread messages on <a href=\"[SITE_URL]\">[SITE_URL]</a>. Please log in again to read them.</p>\n<p>Sincerely,</p>','',1,0,1,NULL,NULL,'Système',NULL,NULL),(81,'messenger_reminder_group','Pending Messages / Messages en attente de réponse','','<p>New messages from applicants have arrived on <a href=\"[SITE_URL]\">[SITE_URL]</a>. Please log in to view them: [FNUMS]</p>\n<p>Thank you in advance,</p>\n<p>Sincerely,</p>\n<hr />\n<p>Des nouveaux messages de déposants sont arrivés sur <a href=\"[SITE_URL]\">[SITE_URL]</a>. Veuillez vous connecter afin d\'en prendre connaissance : [FNUMS]</p>\n<p>Merci d\'avance,</p>\n<p>Cordialement,</p>','',1,0,1,0,0,'Système','',0),(82,'installation_new_language','Suggestion/Installation d\'une langue','','<p>La plateforme <a href=\"[SITE_URL]\">[SITE_URL]</a> souhaiterait installer la langue suivante : [LANGUAGE_FIELD].</p>','',1,0,1,NULL,NULL,'Système',NULL,NULL);
