INSERT INTO `jos_emundus_widgets` VALUES (1,'faq','F.A.Q',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,'files_number_by_status','Files number',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,'users_by_month','Users by month',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,'tips','Tips',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(5,'custom','COM_EMUNDUS_DASHBOARD_FILES_BY_STATUS',10,12,'php|$db = JFactory::getDbo();\n$query = $db->getQuery(true);\n\ntry {\n    $query->select(\'*\')\n        ->from($db->quoteName(\'jos_emundus_setup_status\'))\n        ->order(\'ordering\');\n    $db->setQuery($query);\n    $status = $db->loadObjectList();\n\n    $datas = [];\n\n    foreach ($status as $statu) {\n        $file = new stdClass;\n        $file->label = $statu->value;\n\n        $colors = array(\n            \'lightpurple\' => \'#D444F1\',\n            \'purple\' => \'#7959F8\',\n            \'darkpurple\' => \'#663399\',\n            \'lightblue\' => \'#0BA4EB\',\n            \'blue\' => \'#2E90FA\',\n            \'darkblue\' => \'#2970FE\',\n            \'lightgreen\' => \'#15B79E\',\n            \'green\' => \'#238C69\',\n            \'darkgreen\' => \'#20835F\',\n            \'lightyellow\' => \'#5D5B00\',\n            \'yellow\' => \'#EAA907\',\n            \'darkyellow\' => \'#F79009\',\n            \'lightorange\' => \'#C87E00\',\n            \'orange\' => \'#EF681F\',\n            \'darkorange\' => \'#FF4305\',\n            \'lightred\' => \'#EC644B\',\n            \'red\' => \'#DB333E\',\n            \'darkred\' => \'#DB333E\',\n            \'lightpink\' => \'#B04748\',\n            \'pink\' => \'#EE46BC\',\n            \'darkpink\' => \'#F53D68\',\n            \'default\' => \'#5E6580\'\n        );\n\n        $file->color = $colors[$statu->class];\n\n        $query->clear()\n            ->select(\'COUNT(ecc.id) as files\')\n            ->from($db->quoteName(\'#__emundus_campaign_candidature\',\'ecc\'))\n            ->leftJoin($db->quoteName(\'#__emundus_setup_campaigns\',\'esc\').\' ON \'.$db->quoteName(\'esc.id\').\' = \'.$db->quoteName(\'ecc.campaign_id\'))\n            ->where($db->quoteName(\'ecc.status\') . \' = \' . $db->quote($statu->step))\n            ->andWhere($db->quoteName(\'ecc.published\') . \' = \' . $db->quote(1));\n\n        $db->setQuery($query);\n        $file->value = $db->loadResult();\n        $datas[] = $file;\n    }\n\n	$dataSource = new stdClass;\n	$dataSource->chart = new stdClass;\n	$dataSource->chart = array(\n		\'caption\'=> JText::_(\"COM_EMUNDUS_DASHBOARD_FILES_BY_STATUS_CAPTION\"),\n		\'xaxisname\'=> JText::_(\"COM_EMUNDUS_DASHBOARD_STATUS\"),\n		\'yaxisname\'=> JText::_(\"COM_EMUNDUS_DASHBOARD_FILES_BY_STATUS_NUMBER\"),\n		\'animation\' => 1,\n		\'numberScaleValue\' => \"1\",\n		\'numDivLines\' => 1,\n		\'numbersuffix\'=> \"\",\n		\'theme\'=> \"fusion\"\n	);\n	$dataSource->data = $datas;\n	return $dataSource;\n} catch (Exception $e) {\n	return array(\'dataset\' => \'\');\n}','',1,'chart','column2d',NULL,NULL,NULL),(6,'custom','COM_EMUNDUS_DASHBOARD_USERS_BY_MONTH',10,1,'php|$db = JFactory::getDbo();\n$query = $db->getQuery(true);\n$offset = JFactory::getApplication()->get(\'offset\', \'UTC\');\n$now = new DateTime(gmdate(\"Y-m-d H:i:s\"), new DateTimeZone(\'UTC\'));\n$now = $now->setTimezone(new DateTimeZone($offset));\n\ntry {\n    $users = array();\n    $days = array();\n    $users_by_day = array();\n\n    $query->select(\'COUNT(id) as users\')\n        ->from($db->quoteName(\'#__users\'));\n    $db->setQuery($query);\n    $totalUsers = $db->loadResult();\n\n    $dateTime = $now;\n\n    for ($d = 1;$d < 31;$d++){\n        $user = new stdClass;\n        $day = new stdClass;\n        $query->clear()\n            ->select(\'COUNT(id) as users\')\n            ->from($db->quoteName(\'#__users\'))\n            ->where($db->quoteName(\'id\') . \' != \' . $db->quote(62))\n            ->andWhere(\'YEAR(registerDate) = \' . $db->quote($dateTime->format(\'Y\')))\n            ->andWhere(\'MONTH(registerDate) = \' . $db->quote($dateTime->format(\'m\')))\n            ->andWhere(\'DAY(registerDate) = \' . $db->quote($dateTime->format(\'j\')));\n\n        $db->setQuery($query);\n        $user = (int) $db->loadResult();\n        $day = $dateTime->format(\'d\') . \'/\' . $dateTime->format(\'m\');\n        $users[] = $user;\n        $days[] = $day;\n        $users_by_day[] = array(\'label\' => $day, \'value\' => $user);\n\n        $dateTime->modify(\'-1 day\');\n    }\n\n    $dataSource = new stdClass;\n    $dataSource->chart = new stdClass;\n    $dataSource->chart = array(\n        \'caption\'=> JText::_(\"COM_EMUNDUS_DASHBOARD_USERS_BY_MONTH_CAPTION\"),\n        \'subcaption\'=> JText::_(\"COM_EMUNDUS_DASHBOARD_USERS_TOTAL\") . $totalUsers . JText::_(\"COM_EMUNDUS_DASHBOARD_USERS\"),\n        \'xaxisname\'=> JText::_(\"COM_EMUNDUS_DASHBOARD_USERS_DAYS\"),\n        \'yaxisname\'=> JText::_(\"COM_EMUNDUS_DASHBOARD_USERS_NUMBER\"),\n        \'animation\' => 1,\n        \'yAxisMinValue\'=> 0,\n        \'setAdaptiveYMin\'=> 0,\n        \'adjustDiv\'=> 0,\n        \'yAxisValuesStep\'=> 10,\n        \'numbersuffix\'=> \"\",\n        \'theme\'=> \"fusion\"\n    );\n    $dataSource->categories = [];\n    $dataSource->categories[] = array(\n        \'category\' => $days\n    );\n    $dataSource->data = array_reverse($users_by_day);\n    return $dataSource;\n} catch (Exception $e) {\n	return array(\'users\' => \'\', \'days\' => \'\', \'total\' => 0);\n}',NULL,1,'chart','line',NULL,NULL,NULL),(7,'custom','COM_EMUNDUS_DASHBOARD_FILES_ASSOCIATED_BY_STATUS',10,12,'php|$db = JFactory::getDbo();\n$query = $db->getQuery(true);\n\n$user_id = JFactory::getUser()->id;\n\ntry {\n    $query->select(\'*\')\n        ->from($db->quoteName(\'jos_emundus_setup_status\'))\n        ->order(\'ordering\');\n    $db->setQuery($query);\n    $status = $db->loadObjectList();\n\n    $datas = [];\n\n    foreach ($status as $statu) {\n        $file = new stdClass;\n        $file->label = $statu->value;\n\n        $colors = array(\n            \'lightpurple\' => \'#D444F1\',\n            \'purple\' => \'#7959F8\',\n            \'darkpurple\' => \'#663399\',\n            \'lightblue\' => \'#0BA4EB\',\n            \'blue\' => \'#2E90FA\',\n            \'darkblue\' => \'#2970FE\',\n            \'lightgreen\' => \'#15B79E\',\n            \'green\' => \'#238C69\',\n            \'darkgreen\' => \'#20835F\',\n            \'lightyellow\' => \'#5D5B00\',\n            \'yellow\' => \'#EAA907\',\n            \'darkyellow\' => \'#F79009\',\n            \'lightorange\' => \'#C87E00\',\n            \'orange\' => \'#EF681F\',\n            \'darkorange\' => \'#FF4305\',\n            \'lightred\' => \'#EC644B\',\n            \'red\' => \'#DB333E\',\n            \'darkred\' => \'#DB333E\',\n            \'lightpink\' => \'#B04748\',\n            \'pink\' => \'#EE46BC\',\n            \'darkpink\' => \'#F53D68\',\n            \'default\' => \'#5E6580\'\n        );\n\n        $file->color = $colors[$statu->class];\n\n        $query->clear()\n            ->select(\'distinct eua.fnum as files\')\n            ->from($db->quoteName(\'#__emundus_users_assoc\',\'eua\'))\n            ->leftJoin($db->quoteName(\'#__emundus_campaign_candidature\',\'cc\').\' ON \'.$db->quoteName(\'cc.fnum\').\' = \'.$db->quoteName(\'eua.fnum\'))\n            ->where($db->quoteName(\'cc.status\').\' = \'.$db->quote($statu->step))\n			->andWhere($db->quoteName(\'cc.published\').\' = \'.$db->quote(1))\n            ->andWhere($db->quoteName(\'eua.user_id\').\' = \'.$db->quote($user_id));\n\n        $db->setQuery($query);\n        $files_user_assoc = $db->loadColumn();\n\n        $query->clear()\n            ->select(\'distinct ega.fnum as files\')\n            ->from($db->quoteName(\'#__emundus_group_assoc\',\'ega\'))\n            ->leftJoin($db->quoteName(\'#__emundus_campaign_candidature\',\'cc\').\' ON \'.$db->quoteName(\'cc.fnum\').\' = \'.$db->quoteName(\'ega.fnum\'))\n            ->leftJoin($db->quoteName(\'#__emundus_groups\',\'eg\').\' ON \'.$db->quoteName(\'eg.group_id\').\' = \'.$db->quoteName(\'ega.group_id\'))\n            ->where($db->quoteName(\'cc.status\').\' = \'.$db->quote($statu->step))\n			->andWhere($db->quoteName(\'cc.published\').\' = \'.$db->quote(1))\n            ->andWhere($db->quoteName(\'eg.user_id\').\' = \'.$db->quote($user_id));\n\n        $db->setQuery($query);\n        $files_group_assoc = $db->loadColumn();\n\n        $query->clear()\n            ->select(\'distinct cc.fnum as files\')\n            ->from($db->quoteName(\'#__emundus_groups\',\'eg\'))\n            ->leftJoin($db->quoteName(\'#__emundus_setup_groups_repeat_course\',\'esgrc\').\' ON \'.$db->quoteName(\'esgrc.parent_id\').\' = \'.$db->quoteName(\'eg.group_id\'))\n            ->leftJoin($db->quoteName(\'#__emundus_setup_campaigns\', \'esc\').\' ON \'.$db->quoteName(\'esc.training\').\' = \'.$db->quoteName(\'esgrc.course\'))\n            ->leftJoin($db->quoteName(\'#__emundus_campaign_candidature\',\'cc\').\' ON \'.$db->quoteName(\'cc.campaign_id\').\' = \'.$db->quoteName(\'esc.id\'))\n            ->where($db->quoteName(\'cc.status\').\' = \'.$db->quote($statu->step))\n			->andWhere($db->quoteName(\'cc.published\').\' = \'.$db->quote(1))\n            ->andWhere($db->quoteName(\'eg.user_id\').\' = \'.$db->quote($user_id));\n\n        $db->setQuery($query);\n        $files_group_programs = $db->loadColumn();\n\n        $file->value = sizeof(array_unique(array_merge($files_user_assoc,$files_group_assoc,$files_group_programs)));\n        $datas[] = $file;\n    }\n\n	$dataSource = new stdClass;\n	$dataSource->chart = new stdClass;\n	$dataSource->chart = array(\n		\'caption\'=> JText::_(\"COM_EMUNDUS_DASHBOARD_FILES_ASSOCIATED_BY_STATUS_CAPTION\"),\n		\'xaxisname\'=> JText::_(\"COM_EMUNDUS_DASHBOARD_STATUS\"),\n		\'yaxisname\'=> JText::_(\"COM_EMUNDUS_DASHBOARD_FILES_BY_STATUS_NUMBER\"),\n		\'animation\' => 1,\n		\'numberScaleValue\' => \"1\",\n		\'numDivLines\' => 1,\n		\'numbersuffix\'=> \"\",\n		\'theme\'=> \"fusion\"\n	);\n	$dataSource->data = $datas;\n	return $dataSource;\n} catch (Exception $e) {\n	return array(\'dataset\' => \'\');\n}','',1,'chart','column2d',NULL,NULL,NULL),(8,'custom','Files by status - Number',6,12,'php|$db = JFactory::getDbo();\n$query = $db->getQuery(true);\n\n$user_id = JFactory::getUser()->id;\n\ntry {\n    $query->select(\'*\')\n        ->from($db->quoteName(\'jos_emundus_setup_status\'));\n    $db->setQuery($query);\n    $status = $db->loadObjectList();\n\n    $datas = [];\n\n    foreach ($status as $statu) {\n        $file = new stdClass;\n        $file->label = $statu->value;\n\n        $query->clear()\n            ->select(\'distinct eua.fnum as files\')\n            ->from($db->quoteName(\'jos_emundus_users_assoc\',\'eua\'))\n            ->leftJoin($db->quoteName(\'jos_emundus_campaign_candidature\',\'cc\').\' ON \'.$db->quoteName(\'cc.fnum\').\' = \'.$db->quoteName(\'eua.fnum\'))\n            ->where($db->quoteName(\'cc.status\') . \'=\' . $db->quote($statu->step))\n            ->andWhere($db->quoteName(\'eua.user_id\') . \'=\' . $db->quote($user_id));\n\n        $db->setQuery($query);\n        $files_user_assoc = $db->loadColumn();\n\n        $query->clear()\n            ->select(\'distinct ega.fnum as files\')\n            ->from($db->quoteName(\'jos_emundus_group_assoc\',\'ega\'))\n            ->leftJoin($db->quoteName(\'jos_emundus_campaign_candidature\',\'cc\').\' ON \'.$db->quoteName(\'cc.fnum\').\' = \'.$db->quoteName(\'ega.fnum\'))\n            ->leftJoin($db->quoteName(\'jos_emundus_groups\',\'eg\').\' ON \'.$db->quoteName(\'eg.group_id\').\' = \'.$db->quoteName(\'ega.group_id\'))\n            ->where($db->quoteName(\'cc.status\') . \'=\' . $db->quote($statu->step))\n            ->andWhere($db->quoteName(\'eg.user_id\') . \'=\' . $db->quote($user_id));\n\n        $db->setQuery($query);\n        $files_group_assoc = $db->loadColumn();\n\n        $file->value = sizeof(array_unique(array_merge($files_user_assoc,$files_group_assoc)));\n        $datas[] = $file;\n    }\n\n    $text = \'<h1>\'.JText::_(\"COM_EMUNDUS_DASHBOARD_FILES_BY_STATUS\").\'</h1>\';\n    $text .= \'<div class=\"widget-files-status-number-block\">\';\n    foreach ($datas as $data){\n        $text .= \'<div style=\"text-align: center\"><h1>\'.$data->value.\'</h1><p>\'.$data->label.\'</p></div>\';\n    }\n    $text .= \'</div>\';\n    return $text;\n} catch (Exception $e) {\n    return array(\'dataset\' => \'\');\n}\n','widget-files-status-number',1,'other','',NULL,NULL,NULL),(9,'custom','COM_EMUNDUS_DASHBOARD_FILES_BY_TAG',10,12,'php|$db = JFactory::getDbo();\n$query = $db->getQuery(true);\n\ntry {\n	$query->select(\'*\')\n		->from($db->quoteName(\'jos_emundus_setup_action_tag\'));\n	$db->setQuery($query);\n	$tags = $db->loadObjectList();\n\n	$datas = array();\n\n	foreach ($tags as $tag) {\n		$file = new stdClass;\n		$file->label = $tag->label;\n\n		$query->clear()\n			->select(\'COUNT(distinct eta.fnum) as files\')\n			->from($db->quoteName(\'jos_emundus_tag_assoc\',\'eta\'))\n			->where($db->quoteName(\'eta.id_tag\').\' = \'.$db->quote($tag->id));\n\n		$db->setQuery($query);\n		$file->value = $db->loadResult();\n		$datas[] = $file;\n	}\n\n	$dataSource = new stdClass;\n	$dataSource->chart = new stdClass;\n	$dataSource->chart = array(\n		\'caption\'=> JText::_(\"COM_EMUNDUS_DASHBOARD_FILES_BY_TAG_CAPTION\"),\n		\'xaxisname\'=> JText::_(\"COM_EMUNDUS_DASHBOARD_TAGS\"),\n		\'yaxisname\'=> JText::_(\"COM_EMUNDUS_DASHBOARD_FILES_BY_TAG_NUMBER\"),\n		\'animation\' => 1,\n		\'numbersuffix\'=> \"\",\n		\'theme\'=> \"fusion\"\n	);\n	$dataSource->data = $datas;\n	return $dataSource;\n} catch (Exception $e) {\n	return array(\'dataset\' => \'\');\n}','',1,'chart','pie2d',NULL,NULL,NULL),(10,'custom','FAQ',2,2,NULL,'faq-widget',1,'article',NULL,1040,NULL,NULL),(11,'custom','Messagerie',10,12,'php|try {\n    $db = JFactory::getDbo();\n    $query = $db->getQuery(true);\n\n    $user = JFactory::getUser();\n    $e_user = JFactory::getSession()->get(\'emundusUser\');\n\n    $query->select(\'group_id\')\n        ->from($db->quoteName(\'#__emundus_groups\'))\n        ->where($db->quoteName(\'user_id\') . \' = \' . $user->id);\n    $db->setQuery($query);\n    $user_groups = $db->loadColumn();\n\n    $query->clear()\n        ->select(\'user_id\')\n        ->from($db->quoteName(\'#__emundus_users\'))\n        ->where($db->quoteName(\'profile\') . \' IN (1,2,5,6,1007,1008,1014)\');\n    $db->setQuery($query);\n    $users_not_applicant = $db->loadColumn();\n\n    $query = \"SELECT distinct m.message_id,m.date_time,m.message,ec.fnum,u.name\n    FROM jos_messages m \n    LEFT JOIN `jos_emundus_chatroom` AS `ec` ON `ec`.`id` = `m`.`page` \n    LEFT JOIN `jos_emundus_campaign_candidature` AS `ecc` ON `ecc`.`fnum` = `ec`.`fnum`\";\n    if(!in_array($e_user->profile,[1,2])) {\n        if($e_user->profile != 6) {\n            $query .= \" LEFT JOIN `jos_emundus_group_assoc` AS `ega` ON `ega`.`fnum` = `ecc`.`fnum`\";\n        } else {\n            $query .= \" LEFT JOIN `jos_emundus_users_assoc` AS `eua` ON `eua`.`fnum` = `ecc`.`fnum` AND eua.action_id = 1 AND eua.r = 1\";\n        }\n    }\n    $query .= \" LEFT JOIN `jos_users` AS `u` ON `u`.`id` = `ecc`.`applicant_id` \n    JOIN (SELECT `ec`.`fnum`, MAX(`m`.`message_id`) `message_id` FROM `jos_messages` AS `m` LEFT JOIN `jos_emundus_chatroom` AS `ec` ON `ec`.`id` = `m`.`page` GROUP BY `ec`.`fnum`) m2 \n    ON m.message_id = m2.message_id AND ec.fnum = m2.fnum \n    WHERE `m`.`user_id_from` NOT IN (\" . implode(\',\',$users_not_applicant) . \")\n    AND `ec`.`fnum` IS NOT NULL AND `u`.`id` IS NOT NULL\";\n    if(!in_array($e_user->profile,[1,2])) {\n        if($e_user->profile != 6) {\n            $query .= \" AND `ega`.`group_id` IN (\" . implode(\',\', $user_groups) . \")\";\n        } else {\n            $query .= \" AND `eua`.`user_id` = \" . $db->quote($user->id);\n        }\n    }\n    $query .= \' ORDER BY m.date_time DESC\';\n    $db->setQuery($query);\n    $messages = $db->loadObjectList();\n\n    $text = \'<h2 class=\"widget__message_header\">Messages non-répondus</h2>\';\n\n    if(empty($messages)){\n        $text .= \'<p>Aucun message en attente de réponse.</p>\';\n    } else {\n        foreach ($messages as $message){\n            $date = date_create($message->date_time);\n            $text .= \'<div><span style=\"font-size: 12px\">\' . $message->name . \'</span><br />\';\n            $text .= \'<span style=\"font-size: 12px\">\' . date_format($date,\"d/m/Y H:i\") . \'</span><br />\';\n            $text .= \'<a href=\"/dossiers#\' . $message->fnum . \'\" class=\"widget__message_message em-flex-row\"><p class=\"widget__message_text em-mr-8\">\' . $message->message . \'</p><i class=\"fas fa-reply\"></i></a>\';\n            $text .= \'<hr /></div>\';\n        }\n    }\n\n    return $text;\n} catch (Exception $e) {\n    return \'Erreur : \' . $e->getMessage();\n}','widget__messages__gestionnaire',1,'other',NULL,NULL,NULL,NULL);
