        (346, 'File request  - Accord de confidentialité ', '', 'Accord de confidentialité ', 1, '2014-10-20 14:33:33', 62, 'admin', null, 0, 0, null, 0, 0, '{"split_page":"0","access":"1","intro":"<div>\\r\\n\\t<table width=\\"100%\\" border=\\"0\\" cellspacing=\\"10\\" cellpadding=\\"5\\" >\\r\\n\\t\\t<tbody>\\r\\n\\t\\t\\t<tr>\\r\\n\\t\\t\\t\\t<td width=\\"50%\\" align=\\"left\\" valign=\\"top\\" bgcolor=\\"#F2F2F2\\">\\r\\n\\t\\t\\t\\t\\t<p style=\\"text-align: right;\\"><strong><span style=\\"text-decoration: underline;\\"><a href=\\"images\\/emundus\\/letters\\/engagement_de_confidentialit\\u00e9_2014-10-20_15-49-30.docx\\"><img src=\\"images\\/emundus\\/internationale\\/France48.png\\" alt=\\"\\" \\/>T\\u00e9l\\u00e9charger le document d''accord de confidentialit\\u00e9<\\/a><\\/span><\\/strong>\\r\\n\\t\\t\\t\\t\\t<\\/p>\\r\\n\\t\\t\\t\\t\\t<p style=\\"text-align: justify;\\"><strong><span style=\\"text-decoration: underline;\\">Article 1&nbsp;: confidentialit\\u00e9<\\/span><\\/strong><br \\/><strong>1.1 \\u2013 <\\/strong>Je m\\u2019engage \\u00e0 garder strictement confidentielles et \\u00e0 ne pas divulguer ou communiquer \\u00e0 des tiers, par quelque moyen que ce soit, les informations qui me seront transmises  ou auxquelles j\\u2019aurai acc\\u00e8s \\u00e0 l\\u2019occasion des missions qui me sont confi\\u00e9es. Je m\\u2019engage \\u00e0 n\\u2019utiliser ces informations confidentielles que pour les besoins de l\\u2019ex\\u00e9cution des travaux qui me sont confi\\u00e9s, \\u00e0 ne pas les reproduire sous quelque forme que ce soit sans autorisation \\u00e9crite et pr\\u00e9alable.<br \\/><strong>1.2<\\/strong> \\u2013 Je reconnais donner au mot \\u00ab&nbsp;information&nbsp;\\u00bb une d\\u00e9finition la plus large possible. Notamment, les informations confidentielles peuvent \\u00eatre des informations techniques, scientifiques, commerciales ou industrielles\\u2026<br \\/><strong>1.3 \\u2013 <\\/strong>Je prendrai toutes les mesures n\\u00e9cessaires pour pr\\u00e9server le caract\\u00e8re confidentiel des informations.<br \\/><strong>1.4 \\u2013 <\\/strong>Je m\\u2019engage \\u00e0 ne pas faire de demande de titre de propri\\u00e9t\\u00e9 industrielle, ni \\u00e0 exercer un droit de propri\\u00e9t\\u00e9 intellectuelle ou tout autre droit sur ces informations,<br \\/><strong>1.5 \\u2013 <\\/strong>Je m\\u2019engage \\u00e0 signaler tout conflit d\\u2019int\\u00e9r\\u00eat.<\\/p>\\r\\n\\t\\t\\t\\t\\t<p style=\\"text-align: justify;\\"><strong><span style=\\"text-decoration: underline;\\">Article 2&nbsp;: exceptions<\\/span><\\/strong><br \\/> Toutefois, les dispositions pr\\u00e9vues au pr\\u00e9sent engagement ne s\\u2019appliqueront pas aux informations pour lesquelles je pourrai prouver&nbsp;:<\\/p>\\r\\n\\t\\t\\t\\t\\t<ul style=\\"text-align: justify;\\">\\r\\n\\t\\t\\t\\t\\t\\t<li>que je les poss\\u00e9dais avant la date de communication, ou<\\/li>\\r\\n\\t\\t\\t\\t\\t\\t<li>que ces informations \\u00e9taient du domaine public avant la date de communication ou qu\\u2019elles y sont entr\\u00e9es par la suite sans qu\\u2019une faute puisse m\\u2019\\u00eatre imput\\u00e9e, ou<\\/li>\\r\\n\\t\\t\\t\\t\\t\\t<li>que je les ai re\\u00e7ues sans obligation de secret d\\u2019un tiers autoris\\u00e9 \\u00e0 les divulguer.<\\/li>\\r\\n\\t\\t\\t\\t\\t<\\/ul>\\r\\n\\t\\t\\t\\t\\t<p style=\\"text-align: justify;\\"><strong><span style=\\"text-decoration: underline;\\">Article 3&nbsp;: dur\\u00e9e<\\/span><\\/strong><br \\/> Les dispositions de confidentialit\\u00e9 pr\\u00e9vues au pr\\u00e9sent engagement s\\u2019appliqueront jusqu\\u2019\\u00e0 ce que les informations soient publiquement divulgu\\u00e9es.<\\/p>\\r\\n\\t\\t\\t\\t<\\/td>\\r\\n\\t\\t\\t\\t<td width=\\"50%\\" align=\\"left\\" valign=\\"top\\" bgcolor=\\"#e2e2e2\\" style=\\"text-align: justify;\\">\\r\\n\\t\\t\\t\\t\\t<p style=\\"text-align: right;\\"><strong><span style=\\"text-decoration: underline;\\"><a href=\\"images\\/emundus\\/letters\\/confidentiality_agreement_2014-10-20_15-49-30.docx\\"><img src=\\"images\\/emundus\\/internationale\\/United-Kingdom48.png\\" alt=\\"\\" \\/>Download the confidentiality agreement<\\/a><\\/span><\\/strong>\\r\\n\\t\\t\\t\\t\\t<\\/p>\\r\\n\\t\\t\\t\\t\\t<p><strong><span style=\\"text-decoration: underline;\\">Article 1: confidentiality<\\/span><\\/strong><br \\/><strong>1.1 \\u2013 <\\/strong>I commit to use the confidential information transmitted only for the necessary tasks of expert review, and I commit not to communicate this information to a third-party or disseminate this information. I commit not to reproduce this information in any form, except with written authorization.<br \\/><strong>1.2<\\/strong> \\u2013 I understand that the word \\u201cinformation\\u201d has a large definition. For instance, confidential information can imply technical, scientific, commercial, or industrial information.<br \\/><strong>1.3 \\u2013 <\\/strong>I shall take all necessary measures to preserve the confidential character of the information.<br \\/><strong>1.4<\\/strong> \\u2013 I commit not to request industrial property, intellectual property, copyright or any other right on information related to the projects before it becomes public (through patents, publications or otherwise). <br \\/><strong>1.5 \\u2013 <\\/strong>I commit to inform each time that I have a conflict of interest.<\\/p>\\r\\n\\t\\t\\t\\t\\t<p><strong><span style=\\"text-decoration: underline;\\">Article 2: exceptions<\\/span><\\/strong><br \\/> However, the above does not apply to information for which I can prove that:<\\/p>\\r\\n\\t\\t\\t\\t\\t<ul>\\r\\n\\t\\t\\t\\t\\t\\t<li>I owned this information before transmitted it to me,<\\/li>\\r\\n\\t\\t\\t\\t\\t\\t<li>this information was in the public domain before transmitted it to me or it entered the public domain independently of my involvement,<\\/li>\\r\\n\\t\\t\\t\\t\\t\\t<li>I received this information free of any obligations from a third-party authorized to distribute it.<\\/li>\\r\\n\\t\\t\\t\\t\\t<\\/ul>\\r\\n\\t\\t\\t\\t\\t<p><strong><span style=\\"text-decoration: underline;\\">Article 3: length of validity<\\/span><\\/strong><br \\/> The confidentiality agreement will apply until all the information is released into the public domain.<\\/p>\\r\\n\\t\\t\\t\\t<\\/td>\\r\\n\\t\\t\\t<\\/tr>\\r\\n\\t\\t<\\/tbody>\\r\\n\\t<\\/table>\\r\\n<\\/div>","outro":"","repeat_group_button":"0","repeat_template":"repeatgroup","repeat_max":"","repeat_min":"","repeat_add_access":"1","repeat_delete_access":"1","repeat_delete_access_user":"","repeat_copy_element_values":"0","group_columns":"1","group_column_widths":"","repeat_group_show_first":"1","random":"0"}'),
