        (7779, 'import_file_model', 647, 'calc', 'Modèle d''import', 0, null, '2022-01-19 18:32:48', 62, 'sysadmin', '2022-01-19 18:45:20', 62, 0, 0, '', 0, 0, 6, 0, '', 1, 1, 0, 0, 0, 1, 0, 0, '{"calc_calculation":"require_once (JPATH_BASE.DS.''components''.DS.''com_emundus''.DS.''helpers''.DS.''files.php'');\\r\\nrequire_once (JPATH_BASE.DS.''components''.DS.''com_emundus''.DS.''models''.DS.''campaign.php'');\\r\\n\\r\\n$m_campaign = new EmundusModelCampaign();\\r\\n\\r\\n$pid = \\"{jos_emundus_setup_csv_import___profile_raw}\\";\\r\\n$cid = \\"{jos_emundus_setup_csv_import___campaign_raw}\\";\\r\\n\\r\\nif($cid > 0) {\\r\\n  $campaign = $m_campaign->getCampaignByID($cid);\\r\\n  $code = $campaign[''training''];\\r\\n  \\r\\n  $elements = EmundusHelperFiles::getElements(array($campaign[''training'']), array($cid), array(), null);\\r\\n  \\r\\n  $fabrik_elements = array(''status'', ''jos_emundus_users___email'', ''jos_emundus_users___firstname'', ''jos_emundus_users___lastname'');\\r\\necho ''<pre>'';\\r\\n  foreach ($elements as $t) {\\r\\n    if(!empty($t->table_join)) {\\r\\n      $fabrik_elements[] = $t->table_join.''___''.$t->element_name;\\r\\n    } else {\\r\\n      $fabrik_elements[] = $t->fabrik_element;\\r\\n    }\\r\\n    echo $t->element_label.'','';\\r\\n  }\\r\\n  \\r\\n  $today  = date(\\"MdYHis\\");\\r\\n  $name   = md5($today.rand(0,10));\\r\\n  $name   = $name.''.csv'';\\r\\n  $file = JPATH_BASE.DS.''tmp''.DS.$name;\\r\\n  if (!$csv = fopen($file, ''w+'')) {\\r\\n      $result = array(''status'' => false, ''msg'' => JText::_(''ERROR_CANNOT_OPEN_FILE'').'' : ''.$file);\\r\\n      echo json_encode((object) $result);\\r\\n      exit();\\r\\n  }\\r\\n  fprintf($csv, chr(0xEF).chr(0xBB).chr(0xBF));\\r\\n  $res = fputcsv($csv, $fabrik_elements, \\",\\", ''\\"'', \\"\\\\\\\\\\");\\r\\n  echo ''<div class=\\"em-link\\"><a class=\\"btn btn-info\\" href=\\"index.php?option=com_emundus&controller=files&task=download&name=''.$name.''\\">''.JText::_(''EXPORT'').''<\\/a><\\/div>'';\\r\\n  echo ''<\\/pre>'';\\r\\n}\\r\\n","calc_format_string":"","calc_on_save_only":"0","calc_ajax":"1","calc_ajax_observe_all":"0","calc_ajax_observe":"","calc_on_load":"0","show_in_rss_feed":"0","show_label_in_rss_feed":"0","use_as_rss_enclosure":"0","rollover":"","tipseval":"0","tiplocation":"top-left","labelindetails":"0","labelinlist":"0","comment":"","edit_access":"1","edit_access_user":"","view_access":"1","view_access_user":"","list_view_access":"1","encrypt":"0","store_in_db":"1","default_on_copy":"0","can_order":"0","alt_list_heading":"","custom_link":"","custom_link_target":"","custom_link_indetails":"1","use_as_row_class":"0","include_in_list_query":"1","always_render":"0","icon_folder":"0","icon_hovertext":"1","icon_file":"","icon_subdir":"","filter_length":"20","filter_access":"1","full_words_only":"0","filter_required":"0","filter_build_method":"0","filter_groupby":"text","inc_in_adv_search":"1","filter_class":"input-medium","filter_responsive_class":"","tablecss_header_class":"","tablecss_header":"","tablecss_cell_class":"","tablecss_cell":"","sum_on":"0","sum_label":"Sum","sum_access":"1","sum_split":"","avg_on":"0","avg_label":"Average","avg_access":"1","avg_round":"0","avg_split":"","median_on":"0","median_label":"Median","median_access":"1","median_split":"","count_on":"0","count_label":"Count","count_condition":"","count_access":"1","count_split":"","custom_calc_on":"0","custom_calc_label":"Custom","custom_calc_query":"","custom_calc_access":"1","custom_calc_split":"","custom_calc_php":"","validations":[]}'),
